drop table if exists person;
drop table if exists female;
drop table if exists male;
drop table if exists address;
drop table if exists phone;
drop table if exists denormalized_person;
drop table if exists weather_input;
drop table if exists weather_output;
create table person (id integer auto_increment, first_name varchar(100), last_name varchar(100), gender char(1), primary key (id));
create table male (id integer auto_increment, first_name varchar(100), last_name varchar(100), primary key(id));
create table female (id integer auto_increment, first_name varchar(100), last_name varchar(100), primary key(id));
create table address (id integer auto_increment, person_id integer, address1 varchar(100), address2 varchar(100), city varchar(100), state varchar(2), postal_code varchar(10), primary key(id));
create table phone (id integer auto_increment, person_id integer, phone_type varchar(10), phone_number varchar(20), primary key (id));
create table denormalized_person (
   first_name varchar(100),
   last_name varchar(100),
   gender char(1),
   address1 varchar(100),
   address2 varchar(100),
   city varchar(100),
   state varchar(2),
   postal_code varchar(10),
   home_phone varchar(20),
   cell_phone varchar(20),
   work_phone varchar(20)
);
create table weather_input (
   postal_code varchar(100)
);
create table weather_output (
    city varchar(100),
    forecast_date date,
    weather_id varchar,
    description varchar(100),
    morning_low integer,
    daytime_high integer,
    precip_pct_day integer,
    precip_pct_night integer
);
create table if not exists runs (id integer auto_increment, exec_time timestamp, primary key (id));
